//SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;
import '@openzeppelin/contracts/token/ERC20/ERC20.sol';
import '@openzeppelin/contracts/token/ERC20/IERC20.sol';
import '@openzeppelin/contracts/security/ReentrancyGuard.sol';
import '@openzeppelin/contracts/utils/math/SafeMath.sol';
import '@openzeppelin/contracts/access/Ownable.sol';

contract FWTVestingLock is Ownable, ReentrancyGuard {
    using SafeMath for uint;

    uint public deployTime;
    uint public endSaleTime;
    uint public duration;
    uint public lockTime;
    uint public rate;
    uint public privateSaleAmount;
    address public busdAdress;
    address public fwtAddress;


    // withdraw period
    uint256 internal constant period = 30 days;

    struct Investor{
        uint totalAmount;
        uint claimedAmount;
        uint amountOfMonth;
    }

    mapping(address => Investor) investors;

    event Claim(address indexed _caller, uint amount);

    constructor(address _fwtAddress, address _busdAdress, uint _privateSaleAmount, uint _rate, uint _duration) {
        deployTime = block.timestamp;
        endSaleTime = deployTime + 7 days;
        fwtAddress = _fwtAddress;
        busdAdress = _busdAdress;
        privateSaleAmount = _privateSaleAmount;
        rate = _rate;
        duration = _duration;
        lockTime = deployTime.add(duration);
    }

    receive() external payable{}

    function buy(uint _amount) external{
        require(block.timestamp <= endSaleTime, 'FWTVL: private sale expired');
        require(privateSaleAmount >= _amount, 'FWTVL: amount is exceed!');

        privateSaleAmount = privateSaleAmount.sub(_amount);
        uint totalUsd = _amount.mul(rate).div(1e12);
        IERC20(busdAdress).transferFrom(_msgSender(), address(this), totalUsd);

        investors[_msgSender()].totalAmount = investors[_msgSender()].totalAmount.add(_amount);
    }

    function getInvestor(address _investorAdd) public view returns (uint totalAmount, uint claimedAmount, uint amountOfMonth){
        totalAmount  = investors[_investorAdd].totalAmount;
        claimedAmount = investors[_investorAdd].claimedAmount;
        amountOfMonth = investors[_investorAdd].amountOfMonth;
    }

    function claim() external nonReentrant{
        require(_msgSender() == tx.origin, "FWTVL: Can not call from contract");

        require(block.timestamp > lockTime, "FWTVL: Cannot transfer out locked tokens yet!");

        uint totalAmount = investors[_msgSender()].totalAmount;
        uint claimedAmount = investors[_msgSender()].claimedAmount;
        uint amountOfMonth = investors[_msgSender()].amountOfMonth;

        require(amountOfMonth < 20, "FWTVL: You have fully claimed!!");

        uint periodAmount = (block.timestamp.sub(lockTime)).div(period).add(1);
        if(periodAmount > 20){
            periodAmount = 20;
        }

        uint pendingPeriodAmount = periodAmount.sub(amountOfMonth);

        uint amount = totalAmount.mul(pendingPeriodAmount).mul(5).div(100); //5% for each months

        require(amount > 0, "FWTVL: pending amount is zero!");

        uint fwtBalance = IERC20(fwtAddress).balanceOf(address(this));
        require(fwtBalance >= amount, "FWTVL: blance of token is not enough for claim!");
        investors[_msgSender()].claimedAmount = claimedAmount.add(amount);
        investors[_msgSender()].amountOfMonth = amountOfMonth.add(pendingPeriodAmount);
        ERC20(fwtAddress).transfer(_msgSender(), amount);

        emit Claim(_msgSender(),amount);
    }

    // function to allow admin to claim *other* ERC20 tokens sent to this contract (by mistake)
    function withdrawERC20Tokens(address _tokenAddress, uint _amount) external onlyOwner {
        require(_tokenAddress != fwtAddress || block.timestamp > lockTime, "FWTVL: Cannot transfer out locked tokens yet!");

        ERC20(_tokenAddress).transfer(_msgSender(), _amount);
    }
}
